My sensitivity to the spaces between people, shaped by early experiences, led me on a journey of self-inquiry, acceptance, and mindfulness. This path evolved into a professional commitment to trauma-informed therapeutic approaches. I have spent years studying and integrating various therapeutic modalities, always with an emphasis on cultivating presence, inner spaciousness, and relational attunement.</p>\", \"61d1d186-dff7-4cbd-b901-256e496e4472\": \"About Karima\", \"e5c63454-6cc2-464a-857b-f5eb1ee3d2b2\": \"Karima Valentina Hočevar\", \"fc438791-5351-42a6-8fe8-98bf5b31a0d8\": [{\"col1\": \"/about-me\", \"col2\": \"Read more\", \"col3\": \"normalLink\"}]}', 1, '2025-03-13 22:44:58', '2025-03-13 22:44:58', '53bde268-ae1a-4a89-b4c2-1fd8d9a5ed47'),
