(158, 158, 1, NULL, '__temp_gbibvotejprtlqudmozjdyqzovcginqztbyg', NULL, '{\"49e3e828-6795-49c5-a82b-3360a0b3664d\":\"This introductory seminar is the prerequisite for the 3-year SE® training and is aimed at people from therapeutic, educational, medical and other healing professions. The seminar is not suitable for people who are primarily working on their own traumatic issues. Please let us know what your professional background is when you book.\",\"eca88837-37fe-4366-9c04-3b186a4046b3\":\"<p>Introductory e-seminar provides a theoretical and practical introduction to trauma healing through Somatic Experiencing (SE®). </p><p>You will learn to work with the holistic inner feeling (felt sense) and develop an understanding of how the \\\"biological completion\\\" works, which is missing in most trauma therapies.</p><p>This introductory seminar is the prerequisite for the 3-year SE® training. </p><p>This seminar is aimed at people from therapeutic, educational, medical and other healing professions. The seminar is not suitable for people who are primarily working on their own traumatic issues. Please let us know what your professional background is when you book. </p>\",\"dffe5daa-5f43-4e4c-bde7-1f63fafb21af\":\"<p>The introductory seminar is a prerequisite for participation in the training in Somatic Experiencing (SE®). After the introductory seminar, the seminar leader gives permission to participate in SE® training.</p>\",\"50fd66aa-669e-462b-bfb3-183483ca7f53\":{\"date\":\"2025-03-14 07:00:00\"},\"3699bcd1-9095-4053-972b-820dc7fdd9fb\":{\"date\":\"2025-03-31 07:00:00\"},\"ee77a16c-2740-4126-b391-d88c9f4ff060\":\"Begins at 10:00 on the first day and ends at 17:00 on the second day.\",\"c6ea490e-ad7d-401f-b119-1404e146ac0e\":{\"date\":\"2025-03-31 07:00:00\"},\"daaa5d42-b397-4793-8d5e-25ada16deeb1\":\"230,00 €\",\"6cbe1a93-eb4b-48f0-b47c-fc314d657898\":false,\"59560f2d-bf2a-4a28-9c90-837018f49967\":\"Online\",\"0e41c5b3-e535-4aa7-a808-ad4cf9b22978\":\"Glyndie Nickers