My sensitivity to the spaces between people, shaped by early experiences, led me on a journey of self-inquiry, acceptance, and mindfulness. This path evolved into a professional commitment to trauma-informed therapeutic approaches. I have spent years studying and integrating various therapeutic modalities, always with an emphasis on cultivating presence, inner spaciousness, and relational attunement. <br />Since 2011, I have been leading and co-leading trainings and seminars on Biodynamic Craniosacral Therapy (BCST) in Slovenia and internationally. My work with BCST has provided insights into the body\'s inherent wisdom and capacity for self-regulation. Since 2015, I have been part of the teaching team and a supervisor for NeuroAffective Relational Model (NARM) trainings across Europe.Through the years of practice, I am in the process of developing an appraoch to process-oriented therapies, called Embodied Psychodynamic Resonance (EPR), which integrates my understanding of wholeness with principles from NARM and BCST.</p>\", \"61d1d186-dff7-4cbd-b901-256e496e4472\": \"About me\", \"e5c63454-6cc2-464a-857b-f5eb1ee3d2b2\": \"Karima Valentina Hočevar\"}', 1, '2025-03-14 02:00:56', '2025-03-14 02:00:56', '341a8177-7b92-4346-ba02-8afe752d3e95'),
